        div className = 'Exposicion1' >
        <
        h1 > Leviantan el Ser y el Ego < /h1> <
        div className = "ImgSeleccionada" >
        <
        img src = { selectedImg }
        alt = 'selected'
        className = 'selected' > < /img> < /
        div > <
